import Footer from "./Footer/footer.tsx";

export default function Index() {
  return (
    <>
      <div style={{ background: 'radial-gradient(circle at center, #D2C0A7, #86827b, #424240)' }}>
        <Header />
        <HeroSection />
        <FeaturesSection />
      </div>
      <ZenPositionSection />
      <Footer />
    </>
  );
}
